import React from 'react'


export default function PokemonCard({pokemon}) {
    return (
        <div className="col-md-3 col-sm-6 mb-5">
            <div className="card">
                <div key={pokemon.name} className="card-header">{pokemon.name}</div>
            </div>

        </div>
    )
}
